import React from 'react';
import "./LoginPage.css";
import LoginCard from '../components/Login/Login';

const Login = () => {
  return (
    <><div className="header">
          <img
              src={require("./juntas-logo.png")}
              alt="logo"
              className='img'/>
    </div>
    <LoginCard /></>
      
  );
}

export default Login;
